var tipuesearch = {"pages": [{'title': 'About', 'text': '神作0.0\xa0\xa0 \n', 'tags': '', 'url': 'About.html'}, {'title': 'Vocabulary', 'text': '/downloads/cambridge_english_vocabulary_list.pdf \n /downloads/The_Oxford_5000.pdf \n /downloads/5000_words.zip \n \n', 'tags': '', 'url': 'Vocabulary.html'}, {'title': 'ChatGpt', 'text': 'Q:2的100次方是多少 \n A:2的100次方等於1,267,650,600,228,229,401,496,703,205,376。 \n Q:你可以用Ptthon寫程式嗎 \n A:是的，我可以使用Python編寫程序。我是使用Python等語言進行訓練和構建的，因此我能夠理解和使用Python語言。如果您有任何Python編程問題或任務，請告訴我，我會盡力幫助您。 \n Q:可以示範嗎 \n A: 當然可以！以下是一個簡單的示例程序，可以計算兩個數的和並打印出結果：  \n \npython \n num1 = 10\nnum2 = 5\nsum = num1 + num2\nprint("The sum of", num1, "and", num2, "is", sum)\n \n 當您運行此程序時，它將輸出以下內容： python The sum of 10 and 5 is 15 這只是一個非常簡單的示例，但是Python的語法非常易於學習和使用，而且功能非常強大。 \n', 'tags': '', 'url': 'ChatGpt.html'}, {'title': '托福', 'text': '托福紙筆測驗(TOEFL ITP®)是用紙、筆填寫答案卡方式，以選擇題方式測驗考生的聽力、文法結構與閱讀能力三大項目，目前不考口說與寫作。測驗對象是國際交換學生、條件式入學學生、語言學校、中等學校與成人學校的學生及大學國際化教育計劃的學生，而TOEFL ITP的成績也常做為社區學院與獎助計劃申請者之報名條件。完整測驗時間為115分鐘，測驗費用為新台幣1,200元。 \n 托福網路測驗(TOEFL iBT®)是現階段北美洲大學入學許可之認證考試，由原先之TOEFL CBT電腦型態測驗於2006年9月停辦後，所改制而成。托福網路測驗(TOEFL iBT®)是使用電腦與耳機麥克風，透過網路即時連線至ETS進行線上測驗，考試範圍涵蓋「聽、說、讀、寫」四項技能，並採取整合技能(Integrated Skills)方試測驗，完整測驗時間為3小時 ，測驗費用為美金235元（約新台幣6,900元）。 \n GRE (Graduate Record Examinations) \n Graduate Record Examinations研究生入學考試 \n 研究生入學考試，是由私立的美國教育考試服務中心主辦的標準化考試，用來測驗大學畢業生的知識技能掌握情況。在很多英語國家特別是美國，GRE成績被作為研究生錄取的標準之一。如今在歐洲，亞太地區也有越來越多的大學，如德國，香港，新加坡的大學，把GRE作為英語授課課程錄取標準之一。 \n \n \n \n \n \n \n', 'tags': '', 'url': '托福.html'}]};